import React from 'react'
import { inject,observer } from 'mobx-react'
// import { toJS } from 'mobx'
// import SearchBar from './SearchBar'
import Table from './Table'

@inject('WorkStore')
@observer
class DefinePage extends React.Component{
  constructor(props){
    super(props)
    this.store = this.props.WorkStore;
  }
  render(){
    return <div className='define-container'>
      {/* <SearchBar
      /> */}
      <Table 
      />
    </div>;
  }
}

export default DefinePage
